        height: 45px;
        width: 303px;
        margin-bottom: 10px;
        font-family: 'Lexend Deca';
        font-size: 20px;

        ::placeholder{
            font-size: 20px;
            color: #DBDBDB;
            font-family: 'Lexend Deca';
            font-size: 20px;
        }
    }
`
