    margin-bottom: 29px;
`
const Days = styled.button`
    width: 30px;
    height: 30px;
    margin-right: 4px;
    background-color: #FFFFFF;
    border: 1px solid #D5D5D5;
    border-radius: 5px;
    font-size: 20px;
    color: #DBDBDB;
`
